import {useNavigate } from 'react-router-dom';
import './signuppage.css'

export default function Signup(){
    const navigate =useNavigate();
        const [showPassword, setShowPassword] = useState(false);
    
    function togglePasswordVisibility() {
        const passwordInput = document.querySelector("#txtPassword");
        if (passwordInput) {
            const type = passwordInput.getAttribute("type") === "password" ? "text" : "password";
            passwordInput.setAttribute("type", type);
        }
        const passwordInput1 = document.querySelector("#txtPassword1");
        if (passwordInput1) {
            const type1 = passwordInput1.getAttribute("type") === "password" ? "text" : "password";
            passwordInput1.setAttribute("type", type1);
        }
    }
    function togglePasswordVisibility() {
        setShowPassword(prevState => !prevState);
    }
    return(
        <div class="box">
            <form action="#" class="form">
                <h1 clas="form-title">Sign Up</h1><br/>

                <div class="form-group">
                    <input type="text" class="form-control" required />
                    <label for="" class="form-label">Enter Your Name</label>
                </div>
                <div class="form-group">
                    <input type="text" class="form-control" required />
                    <label for="" class="form-label">Enter Your Email</label>
                </div>
                <div class="form-group">
                    <input type="text" class="form-control" required />
                    <label for="" class="form-label">Enter Your Phone</label>
                </div>
                <div class="form-group">
                    <input type={showPassword ? "text" : "password"} class="form-control" required id="txtPassword" />
                    <label for="" class="form-label">Enter Your Password</label>
                </div>
                <div class="form-group">
                    <input type={showPassword ? "text" : "password"} class="form-control" required id="txtPassword1" />
                    <label for="" class="form-label">Confirm Password</label>
                </div>
                <div className='form-show'>
                    <input type="checkbox" id="show" onChange={togglePasswordVisibility} checked={showPassword} />
                        <label className="showlabel"  htmlFor="show">Show Password</label>  
                </div><br/>

                <div class="bottom-box" style={{alignItems:"center"}}>
                    <button class="form-button" onClick={()=>{
                        navigate("/login")
                    }}>Login</button>
                </div>
            </form>
        </div>
    )
}
